	public String getkey(){
		if(current_key_used<10){
			String to_return = this.keys.get(this.key_possition);
			this.current_key_used+=1;
			return to_return;
		}else{
			this.current_key_used=0;
			this.key_possition+=1;
			if(!(this.key_possition<this.keys.size())){
				Util.log("------key轮回------");
				this.key_possition=0;
			}
			return this.getkey();
		}
	}
	
